import React from 'react';
import MyFeedWrite from './MyFeedWrite';
import MyFeedList from './MyFeedList';
import '../css/myFeed.scss';
const MyFeed = () => {
  return (
    <div>
      <nav id="menu">
        <ul>
          <li>
            <a href="#">MYFEED</a>
          </li>
          <li>
            <a href="#">MYPHTO</a>
          </li>
        </ul>
      </nav>

      <MyFeedWrite />
      <MyFeedList />
    </div>
  );
};

export default MyFeed;
